import React, { useState } from "react";
import { StyleSheet, Text, View, TouchableOpacity } from "react-native";
import { useSelector, useDispatch } from "react-redux";
import { multiplyTwo } from "./redux/actions/twoaction";
//import useForm from "react-hook-form";

export default function Home() {
  const dispatch = useDispatch();
  const count = useSelector((state) => state.two.count);  
console.log(count, "I am count")
  const handleIncrement = () => {
    console.log('I am here')
    dispatch(multiplyTwo());
  };
//   const handleDecrement = () => {
//     dispatch(decrement());
//   };
  return (
    <View style={styles.container}>
      <Text style={styles.title_text}>Testing</Text>
      <Text style={styles.counter_text}>Count:{count}</Text>

      <TouchableOpacity onPress={handleIncrement} style={styles.btn}>
        <Text style={styles.btn_text}> Multiply2 </Text>
      </TouchableOpacity>
      {/* <TouchableOpacity
        onPress={handleDecrement}
        style={{ ...styles.btn, backgroundColor: "#6e3b3b" }}
      >
        <Text style={styles.btn_text}> Decrement </Text>
      </TouchableOpacity> */}
    </View>
  );
}
const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    flexDirection: "column",
    padding: 50,
  },
  title_text: {
    fontSize: 40,
    fontWeight: "900",
    marginBottom: 55,
  },
  counter_text: {
    fontSize: 35,
    fontWeight: "900",
    margin: 15,
  },
  btn: {
    backgroundColor: "#086972",
    padding: 10,
    margin: 10,
    borderRadius: 10,
  },
  btn_text: {
    fontSize: 23,
    color: "#fff",
  },
});
